class KissMangaProvider(ManhwaLikeProvider):
    register_provider_name: str = "KissManga"
    register_provider_id: str = "kiss_manga"
    def __init__(self, title: str, chapter: int, library_path: str, logo_folder: str) -> None:
        logo = ProviderImage("logo_kissmanga", "png", "base64", "data:image/png;base64,")
        super().__init__(title=title, chapter=chapter, library_path=library_path, logo_folder=logo_folder,
                         specific_provider_website="kissmanga.in", logo=logo, icon=None)
        self.clipping_space = (0, 0, -1, 78)

    def _get_current_chapter_url(self) -> str | None:
        response_data = self._search(self._title)
        if response_data is None:
            return None
        if not response_data["success"]:
            url = f"https://{self._specific_provider_website}/kissmanga/{slugify(self._title)}/" + f"chapter-{self._chapter_str}/"
        else:
            url = response_data["data"][0]["url"] + f"chapter-{self._chapter_str}/"
        if url:
            print("Found URL:" + url)  # Concatenate (add-->+) string, to avoid breaking timestamps
            return url
        return None


class KingOfShojoProvider(ManhwaLikeProvider):
    register_provider_name: str = "KingOfShojo"
    register_provider_id: str = "king_of_shojo"
    def __init__(self, title: str, chapter: int, library_path: str, logo_folder: str) -> None:
        logo = ProviderImage("logo_kingofshojo", "png", "base64", "data:image/png;base64,")
        super().__init__(title=title, chapter=chapter, library_path=library_path, logo_folder=logo_folder,
                         specific_provider_website="kingofshojo.com", logo=logo, icon=None)
        self.clipping_space = (0, 35, -1, 105)

    def _search(self, query=None):
        base_url = self._specific_provider_website
        search_url = f"https://{base_url}?s={query or self._title}"

        response = requests.get(search_url)
        response.raise_for_status()

        soup = BeautifulSoup(response.content, 'html.parser')
        listupd_divs = soup.find_all('div', class_='listupd')  # There is only ever one of these

        # Dictionary to hold titles and urls
        titles_urls = []

        # Iterate through each div to extract titles and urls
        for div in listupd_divs:
            for bsx in div.find_all('div', class_='bsx'):
                a_tag = bsx.find('a')
                if a_tag and 'href' in a_tag.attrs and 'title' in a_tag.attrs:
                    titles_urls.append({"title": a_tag['title'], "url": a_tag['href']})

        return {"data": titles_urls}

    @staticmethod
    def _remove_manga_from_url(url):
        parsed_url = urlparse(url)  # Parse the URL
        path_parts = parsed_url.path.strip('/').split('/')  # Split path into parts

        if path_parts and path_parts[0] == "manga":
            path_parts.pop(0)

        new_path = '/' + '/'.join(path_parts)  # Rebuild the path

        # Reconstruct the full URL without /man
        new_url = urlunparse((parsed_url.scheme, parsed_url.netloc, new_path, '', '', ''))

        return new_url

    def _get_current_chapter_url(self) -> str | None:
        response_data = self._search(self._title)
        if response_data is None:
            return None
        url = f"{self._remove_manga_from_url(response_data['data'][0]['url'].rstrip('/'))}-chapter-{self._chapter_str}/"
        if url:
            print("Found URL:" + url)  # Concatenate (add-->+) string, to avoid breaking timestamps
            return url
        return None

    def get_search_results(self, text):
        if text is None:
            return True
        response_data = self._search(text)
        return ([pack["title"], ""] for pack in response_data["data"])

    def _be_picky(self, soup: BeautifulSoup) -> list[dict]:
        # Find the div with class 'reading-content'
        reading_content_div = soup.find('div', id='readerarea')

        if not reading_content_div:
            return []

        # Extract all image elements within the div
        images = reading_content_div.find_all('img')

        # Define a regex pattern to filter out base64 images (data:...)
        valid_images = []
        for img in images:
            src = img.get('src', '')
            if src and not re.match(r'^data:.*', src):  # Ensures src is not base64
                valid_images.append(img)

        return valid_images


class ReadMangaProvider(ManhwaLikeProvider):
    register_provider_name: str = "ReadManga"
    register_provider_id: str = "read_manga"
    def __init__(self, title: str, chapter: int, library_path: str, logo_folder: str) -> None:
        logo = ProviderImage("logo_readmanga", "png", "base64", "data:image/png;base64,")
        super().__init__(title=title, chapter=chapter, library_path=library_path, logo_folder=logo_folder,
                         specific_provider_website="readmanga.app", logo=logo, icon=None)
        self.clipping_space = (0, 0, -1, -2)

    def _search(self, query=None):
        base_url = self._specific_provider_website
        search_url = f"https://{base_url}/search/autocomplete/?dataType=json&query={query or self._title}"

        response = requests.get(search_url)
        response.raise_for_status()

        results = json.loads(response.text)
        results = results.get("results") if isinstance(results, dict) else results
        if results:
            return {"data": [{"title": data.get("original_title"), "url": data.get("link")} for data in results]}
        return {"data": []}

    def _get_current_chapter_url(self):
        response_data = self._search()
        url = self._get_url(response_data["data"][0]["url"] + f"/chapter-{self.chapter_str}/all-pages",
                            f'chapter {self._chapter} {self._title.title()}')
        if url:
            print("Found URL:" + url)  # Concatenate (add-->+) string, to avoid breaking timestamps
            return url
        return None

    def can_work(self) -> bool:
        return False


